<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="utf-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1.0">
    <link rel="icon" href="<%= BASE_URL %>favicon.ico">
    <link href="//netdna.bootstrapcdn.com/font-awesome/4.7.0/css/font-awesome.min.css" rel="stylesheet">
    <link rel="stylesheet" href="https://unpkg.com/leaflet@1.3.4/dist/leaflet.css"/>
    <script src="https://unpkg.com/leaflet@1.3.4/dist/leaflet.js"></script>
    <script src="http://d3js.org/d3.v5.min.js"></script>
    <title>templates<%= htmlWebpackPlugin.options.title %></title>
</head>
<body>
<noscript>
    <strong>We're sorry but <%= htmlWebpackPlugin.options.title %> doesn't work properly without JavaScript enabled.
        Please enable it to continue.</strong>
</noscript>
<div id="app"></div>
<!-- built files will be auto injected -->
<script type="text/javascript" src="http://leafletjs.com/examples/map-panes/eu-countries.js"></script>
<script src="js/leaflet.ChineseTmsProviders.js" type="text/javascript"></script>
<script src="https://code.jquery.com/jquery-3.5.1.min.js" type="text/javascript"></script>
<script src="https://cdn.staticfile.org/echarts/4.3.0/echarts.min.js" type="text/javascript"></script>
<script src="http://d3js.org/d3.v5.min.js"></script>
<style type="text/css">
    ::-webkit-scrollbar {
        display: none;
    }

    html, body {
        width: 100%;
        height: 100%;
        margin: 0;
        background-color: #191a2c;
    }

    .level1 {
        font-size: 28px;
        font-family: "Microsoft YaHei";
        color: #ffffff;
    }

    .level4 {
        font-size: 14px;
        font-family: "Microsoft YaHei";
        text-align: left;
        color: #ffffff;
    }

    .level5 {
        font-size: 16px;
        font-family: "Microsoft YaHei";
    }

    .level6 {
        font-size: 12px;
        font-family: "Microsoft YaHei";
        color: #ffffff;
    }

    .level7 {
        font-size: 21px;
        font-family: "Microsoft YaHei";
        color: #ffffff;
        font-weight: bold;
    }

    .level8 {
        font-size: 50px;
        font-family: Avenir;
        color: #3ba2ff;
    }

    .level11 {
        font-size: 19px;
        font-family: "Microsoft YaHei";
        color: #ffffff;
    }

    .margin {
        margin: 10px;
    }

</style>
</body>
</html>
